import{_ as t,c as a,a2 as o,o as s}from"./chunks/framework.BQmytedh.js";const i="/assets/searchTabVitePress.BQQ9tthu.png",n="/assets/implementationLevel.Bi75-LW_.png",r="data:image/png;base64,",c="data:image/png;base64,",l="data:image/png;base64,",w=JSON.parse('{"title":"How to use this help?","description":"","frontmatter":{},"headers":[],"relativePath":"data/conversion-howto.md","filePath":"data/conversion-howto.md"}'),m={name:"data/conversion-howto.md"};function A(p,e,d,h,u,f){return s(),a("div",null,e[0]||(e[0]=[o('<h1 id="how-to-use-this-help" tabindex="-1">How to use this help? <a class="header-anchor" href="#how-to-use-this-help" aria-label="Permalink to &quot;How to use this help?&quot;">​</a></h1><p>This WebHelp document can be used in a different way depending on your purposes. You&#39;re free to navigate it as you like but if you need a rapid access to specific parts of informations that are contained inside this webpage. Here are some useful hints:</p><h2 id="searching-for-captured-fields-of-quantum-chemistry-software" tabindex="-1">Searching for captured fields of quantum chemistry software <a class="header-anchor" href="#searching-for-captured-fields-of-quantum-chemistry-software" aria-label="Permalink to &quot;Searching for captured fields of quantum chemistry software&quot;">​</a></h2><p>First of all <strong>you must check whether your format is supported</strong>, so you must first look at webhelp main page under <em>Legacy to CML</em> section if your format is listed there. Then you can continue reading this paragraph, otherwise you must contact our development team to code this new calculation format.</p><p>Once we know that our format is captured, the fastest approach in discovering if such section is processed <strong>is searching few words</strong> from a line of text of such section in WebHelp Search field (on search tab).</p><p><img src="'+i+'" alt="image"></p><p>We must avoid capturing numerical values because our search will fail to find matches, just use alphabetic and symbol characters, p.ex.:</p><ul><li><em>NUCLEAR COORDINATES (ANGSTROMS):</em>,</li><li><em>Rotational constants (GHZ)</em>,</li><li><em>Spin components of T(2) and E(2)</em> ,</li><li><em>The second derivative</em>,</li><li>etc..</li></ul><p>Once we&#39;ve searched such value, a list of matches ordered by relevance will appear:</p><h3 id="when-matching-templates-are-found" tabindex="-1">When matching templates are found <a class="header-anchor" href="#when-matching-templates-are-found" aria-label="Permalink to &quot;When matching templates are found&quot;">​</a></h3><p>If some of the matched templates points to our desired section we must procede to consult it by clicking on it&#39;s link.</p><p>The new page that will appear is a resume of our template, it will display the most relevant information:</p><p>Template name, physical file name, capture start/end regular expressions among other information. There should be also some examples of common inputs and it&#39;s converted output as formatted CML, it will help us in understanding which fields are generated and not.</p><p>On top of this template definition there must be a resume table that defines it&#39;s implementation level :</p><p><img src="'+n+'" alt="image"></p><p>This value will vary depending on current template implementation status:</p><p><img style="float:left;" src="'+r+'"> -&gt; All fields all captured / displayed<br><img style="float:left;" src="'+c+'"> -&gt; Some fields are captured / displayed<br><img style="float:left;" src="'+l+'"> -&gt; No field is captured / displayed</p><h3 id="when-there-are-not-search-matches" tabindex="-1">When there are not search matches <a class="header-anchor" href="#when-there-are-not-search-matches" aria-label="Permalink to &quot;When there are not search matches&quot;">​</a></h3><p>If there are no matches for our section, you can try to find it directly from <em>Conversion templates : Text to CML</em> section inside content tab. If even then you don&#39;t find it, you must contact our development team to code such data extraction template and it&#39;s visualized fields.</p><h2 id="html5-report-data-display-logic-and-source" tabindex="-1">HTML5 report data display logic and source <a class="header-anchor" href="#html5-report-data-display-logic-and-source" aria-label="Permalink to &quot;HTML5 report data display logic and source&quot;">​</a></h2><p>The straight way to access such information is to refer calculation HTML5 conversion related section. To do so we&#39;ll access content tab and then navigate to <em>HTML report content</em> entry, then we must choose selected format and later navigate to <em>Page components detail</em> and then to <em>Header</em> section.</p>',21)]))}const y=t(m,[["render",A]]);export{w as __pageData,y as default};
